import React from 'react'

function Navbar() {
  return (
    <div className="navbar">
      
      <div className="logo__container">
        <img src="https://5studios.net/themes/laapp/img/logo-light.png" alt="logo white" className="logo__one"/>
        <img src="https://5studios.net/themes/laapp/img/logo.png" alt="logo blue" className="logo__two"/>
      </div>

      

    </div>
  )
}



export default Navbar
